import React, { Component } from 'react';

class Signup extends Component {

    SignupForm = () => (
        <form>
            <div className="form-group">
                <label for="exampleInputEmail1">Name</label>
                <input type="text" className="form-control" placeholder="Enter Name" autoComplete="off" />
            </div>
            <div className="form-group">
                <label for="exampleInputEmail1">Email address</label>
                <input type="email" className="form-control" aria-describedby="emailHelp" placeholder="Enter email" autoComplete="off" />
            </div>
            <div className="form-group">
                <label for="exampleInputPassword1">Password</label>
                <input type="password" className="form-control" id="exampleInputPassword1" placeholder="Password" />
            </div>
            <div className=""> 
                <button type="submit" className="btn bg-success">Submit</button>
            </div>
        </form>
    );

    render() {
        return (
            <div className="">
                <div className="jumbotron">
                    <h1>Signup</h1>
                </div>
                <div className="container">
                    { this.Signup() }
                </div>
            </div>
        );
    }
}

export default Signup;
